import React, {useEffect, useState} from 'react'
import './Home.css'
import FlightIcon from '@mui/icons-material/Flight';
import DirectionsCarIcon from '@mui/icons-material/DirectionsCar';
import HotelIcon from '@mui/icons-material/Hotel';
import RoomServiceIcon from '@mui/icons-material/RoomService';
import LocalCafeIcon from '@mui/icons-material/LocalCafe';
import SearchIcon from '@mui/icons-material/Search';

const Home = () => {
  const [select, setselect] = useState("flight");
  const userselect=(witchselect)=>{
    setselect(witchselect);
  }

  useEffect(()=>{
    console.log(select);
  },[ select ])
  return (
    <div className="home-nav">
      <div className="select">
        <button onClick={() => userselect('flight')}><FlightIcon/></button>
        <button onClick={() => userselect('car')}><DirectionsCarIcon/></button>
        <button onClick={() => userselect('hotel')}><HotelIcon/></button>
        <button onClick={() => userselect('food')}><RoomServiceIcon/></button>
        <button onClick={() => userselect('cafe')}><LocalCafeIcon/></button>
      </div>
      <div className="content">
        <input type="text"></input>
        <button><SearchIcon/></button>
      </div>
    </div>
  )
}

export default Home
